const color = {
  primary: "rgb(89,56,37)",
  white: "white",
}

const typography = {
  heading: {
    'fontFamily': 'Philosopher',
    'fontSizing': '1rem'
  },
  paragraph: {
    'fontFamily': 'sans-serif',
    'fontSizing': '0.5rem'
  }
}

const theme = {
  color,
  typography,
}

export default theme;
